import Card  from "./Card";

function Tours({tours,removeTour}){

    return(
      <div>
          <div>
             <h2>Plan With Gnyan</h2>
          </div>
          <div>
              {
                   tours.map( (tour) => {
                    return  <Card {...tour} removeTour ={removeTour}/>
                   } )
              }
          </div>
      </div>
    );
}




export default Tours;
